import CustomButton from "../components/CustomButton"
import { useNavigate } from "react-router-dom";
import star from '../images/star.png'

function Menu() {
    let navigate = useNavigate();

  return (
    <Container>
        <ContentContainer>
            <Icon src={star}/>
            <div>'s photobook</div>
            <div>나의 앨범</div>
            <div>개인정보 관리</div>
            <div>로그아웃</div>
        </ContentContainer>
    </Container>
  );
}

const Container = styled.div`
  font-family: goblin;
  min-height:100vh;
  display:flex;
  flex-direction:column;
  justify-content:center;
  background-color: #000000 45%;
`

const Icon = styled.img`
  width:60px;
  height:60px;
  margin-left:auto;
  margin-right:20px;
  margin-bottom:50px;
`

const Frame = styled.img`
  width:400px;
  height:300px;
  margin-left:auto;
  margin-right:auto;
  @media Screen and (max-width:500px){
    width:320px;
  height:240px;
  }
`
const InputContainer = styled.div`
  display:flex;
  flex-direction:vertical;
  width:800px;
  margin-left:auto;
  margin-right:auto;
  margin-top:20px;
  margin-bottom:10px;
  @media Screen and (max-width:900px){
    width:calc(100vw - 100px);
  }
  @media Screen and (max-width:500px){
    width:300px;
`
const Input  =styled.input`
  width:700px;
  height:30px;
  border-radius:30px 0px 0px 30px;
  background-color:#D9D9D9;
  border: 1px solid black;
  margin-left:20px;
  @media Screen and (max-width:900px){
    width:calc(100vw - 200px);
    @media Screen and (max-width:500px){
        width:300px;
`
const Button = styled.button`
    font-family: goblin;
    font-size:20px;
    width:100px;
    height:34px;
    margin-left:0px;
    margin-right:20px;
    border: 1px solid black;
    border-radius:0px 30px 30px 0px;
    background-color: #FFFFFF;
`
export default Menu;
